import NavBar from './NavBar'
import {Head , HandleClick} from './Head'


function ParentComponent() { const [showHandleClick, setShowHandleClick] = useState(false); function handleButtonClick() { setShowHandleClick(true); } return ( <div> <button onClick={handleButtonClick} type="button">Show HandleClick Component</button> {showHandleClick && <HandleClick />} </div> ); }
function App() {
    return (
        <>
            <NavBar />
            <Head />
            <ParentComponent />
        </>
    )
}

export default App
